import React from "react";
import { LoginContainer,LoginLogo, LoginForm, LoginFormElement, LoginFormSubmit } from "./styles";
import AppLogo from "../../../resources/logo.png";
import Button from "../../neu-components/Button";
import Input from "../../neu-components/Input";

function Login(props) {
  return <LoginContainer>
    <LoginLogo src={AppLogo}/>
    <LoginForm>
      <LoginFormElement>
      <Input label="Email"/></LoginFormElement>
      <LoginFormElement><Input label="Password" type="password"/></LoginFormElement>
      <LoginFormSubmit><Button label="Login"/></LoginFormSubmit>
    </LoginForm>


  </LoginContainer>;
}
export default Login;
